import React, { useState } from 'react';
import './App.css';
import Controls from './Controls';

function App() {  
  const [num, setNum] = useState(10)
  const increase =()=>{ setNum(num+1); }
  const decrease =()=>{ setNum(num-1); }
  return (
    <div className="App">
      <h2> 결과 : {num}</h2>
      <Controls increase={increase} decrease={decrease} />
    </div>
  );
}

export default App;
